    false,nt"url": null,nt"notes": "The Diablo Canyon Power Plant (DCPP) LiDAR
    and Imagery datasets are comprised of three separate LiDAR surveys: Diablo Canyon
    (2010), Los Osos (2011), and San Simeon (2013). The DCPP Los Osos project study
    area is located in San Luis Obispo County, California, and encompasses approximately
    170,000 acres (674.59 square kilometers). Watershed Sciences, Inc. (WSI) collected
    Light Detection and Ranging (LiDAR) data across the project area from 17 March 2011
    to 31 March 2011. The LiDAR survey utilized a Leica ALS60 sensor in a Cessna Caravan.
    The Leica system was set to acquire 105,900 laser pulses per second (i.e., 105.9
    kHz pulse rate) and flown at 900 meters above ground level (AGL), capturing a scan
    angle of +/- 14 degrees from nadir when clouds and terrain permitted. With these
    flight parameters, the laser swath width is 449 m and the laser pulse footprint
    is 21 cm. These settings yield an average native pulse density of equal-to-or-more-than
    8 pulses per square meter over terrestrial surfaces.",nt"license_title": null,nt"extras":
